import React from "react";
import './header.css';
import background from './images/imageuno.jpeg'

const Header = () => {
  return (
    <div style={{ 
        backgroundImage: `url(${background})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        width: '100vw',
        height: '100vh'
    }}>
        <h1 className="title">Ferrer Drywall LLC</h1>
        <h2 className="title2">Proudly serving the Winston Salem, Clemmons and Mocksville area for over 20 years!</h2>
    </div>
  )
}


export default Header;
